import React from "react";

const Weather = () => {
  return (
    <>
      <div class="container default-city">
        <div class="row align-items-start">
          <div class="col city1">
            <h1>Singapore</h1>
          </div>

          <div class="col city2">
            <h1>Prague</h1>
          </div>

          <div class="col city3">
            <h1>Brisbane</h1>
          </div>
        </div>
      </div>
    </>
  );
};

export default Weather;
